import '../style/contact.css';
import NavBar from './HomeNavBar';
function ContactUs(){
    const title = 'Contact Us'
    return(
        <div className="contact">
            <HomeNavbar />
            <div className="content">
                <h1>{ title }</h1>
                </div>
        </div>
    );
}
export default ContactUs;
